Who is Sara Calaway? Sara Calaway is the former&nbsp;wife of WWE superstar&nbsp;The Undertaker.&nbsp;
She was a valet for The Undertaker in the WWE in 2001 and 2002.
Sara made her WWF debut in videos filmed by a stalker, which aired on Raw on May 28, 2001.
Later, she dissolved her long-term marriage to Mark Calaway, also known as The Undertaker, in 2007.&nbsp;
