A South Carolina second-grade teacher had her teaching license suspended after she is said to have offered students weed gummies as a reward for good behavior.&nbsp;
One of Victoria Weiss’ students allegedly pulled a pack of Stony Patch Kids – a THC-infused candy that resembles Sour Patch Kids – out of the prize box in her Rocky Creek Elementary School classroom earlier this fall.&nbsp;
The South Carolina School Board of Education suspended her license due to the ‘serious nature of this allegation of misconduct’ and because Weiss, 27, ‘may pose a threat to the health, safety and welfare of students.
